pragma solidity ^0.4.17;


import './Limited.sol';
import './WithActions.sol';

import './interfaces/IContractProvider.sol';


contract EntityRegistry is ContractProviderEnabled, Limited {

    struct Entity {
        bytes32 name;
        address owner;
        bytes32 phone;
        bytes32 email;
        uint256 index;
    }

    // entities hashtable, entityId => Entity
    mapping(bytes32 => Entity) public entities;

    // entityId => broker
    mapping(bytes32 => mapping(address => bool)) public delegates;

    // entities look up table
    bytes32[] public entitiesLUT;

    event LogNewEntity(
        bytes32 indexed entityId,
        address owner,
        bytes32 indexed name,
        bytes32 phone,
        bytes32 indexed email,
        uint256 index
    );

    event LogEntityUpdated(
        bytes32 indexed entityId,
        address owner,
        bytes32 indexed name,
        bytes32 phone,
        bytes32 indexed email,
        uint256 index
    );

    event LogEntityRemoved(
        bytes32 indexed entityId,
        address owner,
        bytes32 indexed name,
        bytes32 phone,
        bytes32 indexed email,
        uint256 index
    );

    event LogNewDelegate(
        bytes32 indexed entityId,
        address delegate,
        address sender
    );

    event LogRemoveDelegate(
        bytes32 indexed entityId,
        address delegate,
        address sender
    );

    function confirmRegisteredEntity(bytes32 entityId) public view returns (bool) {
        require(entityId != '');
        require(entities[entityId].name != '');
        require(entities[entityId].phone != '');
        require(entities[entityId].email != '');

        return true;
    }

    function getOwner(bytes32 entityId) public view returns (address) {
        return entities[entityId].owner;
    }

    /**
     * Returns entity's attributes 
     */
    function getEntity(bytes32 entityId)
        public
        view
        returns (bytes32 name, address owner, bytes32 phone, bytes32 email, uint256 index)
    {
        require(entityId != '');

        Entity storage entity = entities[entityId];
        return (entity.name, entity.owner, entity.phone, entity.email, entity.index);
    }

    function delegateAddress(bytes32 entityId, address delegate)
        public
        performs(NetworkActivity.ModifyEntity)
        returns(bool)
    {
        address entityOwner = entities[entityId].owner;
        require(msg.sender == entityOwner || delegates[entityId][msg.sender]);
        delegates[entityId][delegate] = true;
        LogNewDelegate(entityId, delegate, msg.sender);
        return true;
    }

    function removeDelegateAddress(bytes32 entityId, address delegate)
        public
        performs(NetworkActivity.ModifyEntity)
        returns(bool)
    {
        address entityOwner = entities[entityId].owner;
        require(msg.sender == entityOwner || delegates[entityId][msg.sender]);
        delegates[entityId][delegate] = false;
        LogRemoveDelegate(entityId, delegate, msg.sender);
        return true;
    }

    /**
     * Register new entity
     */
    function registerEntity(
        bytes32 entityId,
        address owner,
        bytes32 name,
        bytes32 phone,
        bytes32 email
    )
        public
        performs(NetworkActivity.RegisterEntity)
        returns (bool)
    {
        require(owner != address(0));
        require(entities[entityId].owner == address(0));
        require(entities[entityId].name == '');
        require(entities[entityId].phone == '');
        require(entities[entityId].email == '');

        entities[entityId] = Entity(name, owner, phone, email, entitiesLUT.length);
        entitiesLUT.push(entityId);

        LogNewEntity(entityId, owner, name, phone, email, entitiesLUT.length - 1);
        return true;
    }

    /**
     * Update existing entity
     */
    function updateEntity(
        bytes32 entityId,
        address owner,
        bytes32 name,
        bytes32 phone,
        bytes32 email
    )
        public
        performs(NetworkActivity.ModifyEntity)
        returns (bool)
    {
        require(entityId != '');
        Entity storage entity = entities[entityId];
        // only owner or delegated address can update
        require(msg.sender == entity.owner || delegates[entityId][msg.sender]);
        require(entity.name != ''
            || entity.owner != address(0)
            || entity.phone != ''
            || entity.email != ''
        );

        entity.name = name;
        entity.owner = owner;
        entity.phone = phone;
        entity.email = email;

        LogEntityUpdated(entityId, owner, name, phone, email, entity.index);
        return true;
    }

    /**
     * Remove existing entity
     */
    function removeEntity(bytes32 entityId)
        public
        performs(NetworkActivity.ModifyEntity)
        returns (bool)
    {
        require(entityId != '');

        Entity memory entity = entities[entityId];
        // only owner or delegated address can remove
        require(msg.sender == entity.owner || delegates[entityId][msg.sender]);

        uint256 index = entities[entityId].index;
        // order does not matter so move last element to the deleted index
        entitiesLUT[index] = entitiesLUT[entitiesLUT.length - 1];
        entities[entitiesLUT[index]].index = index;
        // remove last element
        entitiesLUT.length--;
        // remove Entity from mapping
        delete entities[entityId];

        LogEntityRemoved(
            entityId,
            entity.owner,
            entity.name,
            entity.phone,
            entity.email,
            index
        );

        return true;
    }

}
